import axios from 'axios';
import React from 'react';

class App extends React.Component {
  state = {deatils: [], }

  componentDidMount(){

    let data;
    axios.get('https://127.0.0.1:8000/api/apify-data/')
    .then(res => {
      data = res.data;
      this.setState({
        details: data 
      });
    })
    .catch(err => {})
  }
}
export default App;
